import React from 'react'

const Header = (props) =>{
    let {color, backgroundColor} = props;
    const styles ={
        color,
        backgroundColor
    }
    return(
        <div style={styles}>
            <div>
            {props.title}
            {props.subtitle}
        </div>
        </div>
    )
}
export default Header
